import { Avatar } from '@material-ui/core';
import React from 'react';
import './Sidebar.css';

function SidebarChat() {
  return (
    <div classnName='sidebarChat'>
      <Avatar />
      <div className='sidebarChatInfo'>
        <h2>Room Name</h2>
        <p>This is the last message</p>
      </div>
    </div>
  )
}

export default SidebarChat;
